def check_if_last_char_is_a_letter(txt):
    if not txt:
        return False
    last_char = txt[-1]
    return last_char.isalpha() and (txt[:-2] + ' ' + txt[-1]).count(' ') == 0

def can_arrange(arr):
    for i in range(1, len(arr)):
        if arr[i] > arr[i-1]:
            return i-1
    return -1

def largest_smallest_integers(lst):
    negatives = [x for x in lst if x < 0]
    positives = [x for x in lst if x > 0]

    if negatives and positives:
        return (max(negatives), min(positives))
    elif negatives:
        return (max(negatives), None)
    elif positives:
        return (None, min(positives))
    else:
        return (None, None)

def compare_one(a, b):
    a = float(str(a).replace('.', '').replace(',', '.'))
    b = float(str(b).replace('.', '').replace(',', '.'))

    if str(a) == str(b):
        return None
    elif a > b:
        return str(a)
    else:
        return str(b)

