def file_name_check(file_name):
    if not isinstance(file_name, str) or len(file_name) == 0:
        return 'No'

    before_dot = file_name.split('.')[0]
    after_dot = '.'.join(file_name.split('.')[-2:]).split('.')[1]

    if (not before_dot[0].isalpha()) or not after_dot in ['txt', 'exe', 'dll']:
        return 'No'

    digits_count = sum(1 for char in file_name if char.isdigit())

    if digits_count > 3:
        return 'No'

    if len(file_name.split('.')) != 2:
        return 'No'

    return 'Yes'

