def is_prime(n):
    if n < 2:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True

def words_in_sentence(sentence):
    words = sentence.split()
    result = [word for word in words if is_prime(len(word))]
    return ' '.join(result)

def simplify(x, n):
    x_num, x_den = map(int, x.split('/'))
    n_num, n_den = map(int, n.split('/'))
    product_numerator = x_num * n_num
    product_denominator = x_den * n_den
    def gcd(a, b):
        while b:
            a, b = b, a % b
        return a
    common_divisor = gcd(product_numerator, product_denominator)
    simplified_product_numerator = product_numerator // common_divisor
    simplified_product_denominator = product_denominator // common_divisor
    if simplified_product_denominator == 1:
        return True
    else:
        return False

def specialFilter(nums):
    count = 0
    for num in nums:
        if abs(num) > 10 and (num % 10 not in [1, 3, 5, 7, 9] or (num // 10) % 10 in [2, 4, 6, 8, 0]):
            count += 1
    return count

def get_max_triples(n):
    a = [i * i - i + 1 for i in range(1, n+1)]
    count = 0
    freq = {}
    for num in a:
        if num % 3 not in freq:
            freq[num % 3] = 1
        else:
            freq[num % 3] += 1
    count += (freq.get(0, 0) * (freq.get(1, 0) - 1) * (freq.get(2, 0) - 2)) // 6
    count += (freq.get(1, 0) * (freq.get(2, 0) - 1)) // 3
    return count

def bf(planet1, planet2):
    planets = ["Mercury", "Venus", "Earth", "Mars", "Jupiter", "Saturn", "Uranus", "Neptune"]
    if planet1 not in planets or planet2 not in planets:
        return ()

    i1, i2 = planets.index(planet1), planets.index(planet2)
    between = sorted([planets[j] for j in range(i1 + 1, i2) if planets[j] != planet1 and planets[j] != planet2])
    return tuple(between)

