def even_odd_count(num):
    even = 0
    odd = 0
    for digit in str(abs(num)):
        if int(digit) % 2 == 0:
            even += 1
        else:
            odd += 1
    return (even, odd)

def int_to_mini_roman(number):
    if not 1 <= number <= 1000:
        raise ValueError("Input must be between 1 and 1000")

    def roman(num):
        val = [
            1000, 900, 500, 400,
            100, 90, 50, 40,
            10, 9, 5, 4,
            1
            ]
        syb = [
            "M", "CM", "D", "CD",
            "C", "XC", "L", "XL",
            "X", "IX", "V", "IV",
            "I"
            ]
        roman_num = ''
        i = 0
        while  num > 0:
            for _ in range(num // val[i]):
                roman_num += syb[i]
                num -= val[i]
            i += 1
        return roman_num.lower()

    return roman(number)

def find_max(words):
    max_word = ""
    max_unique_chars = 0
    for word in words:
        unique_chars = len(set(word))
        if unique_chars > max_unique_chars or (unique_chars == max_unique_chars and word < max_word):
            max_word = word
            max_unique_chars = unique_chars
    return max_word

def do_algebra(operator, operand):
    expression = ""
    for i in range(len(operand) - 1):
        expression += str(operand[i]) + operator[i]
    expression += str(operand[-1])
    return eval(expression)

def solve(s):
    result = ""
    reverse = False
    for char in s:
        if not char.isalpha():
            result += char
            continue
        if result and result[-1].islower() and char.isupper():
            reverse = True
        elif result and result[-1].isupper() and char.islower():
            reverse = False
        if reverse:
            result += char.upper()
        else:
            result += char.lower()
    if not any(c.isalpha() for c in s):
        return "".join(reversed(result))
    return result

import hashlib

def string_to_md5(text):
    if not text:
        return None
    md5_hash = hashlib.md5(text.encode('utf-8'))
    return md5_hash.hexdigest()

def generate_integers(a, b):
    if a > b:
        a, b = b, a
    even_digits = [i for i in range(a, b+1) if i % 2 == 0]
    return sorted(even_digits)
